import React from "react";
import "./index.css";

const Slotmachine = (props) => {
  if (props.x === props.y && props.y === props.z) {
    return (
      <>
        <div className="slot_inner">
          <h1>
            {props.x}
            {props.y}
            {props.z}
          </h1>
          <h1>You Won</h1>
          <hr />
        </div>
      </>
    );
  } else {
    return (
      <>
        <div className="slot_inner">
          <h1>
            {props.x}
            {props.y}
            {props.z}
          </h1>
          <h1>you lost</h1>
          <hr />
        </div>
      </>
    );
  }
};

const App = () => {
  return (
    <>
      <h1 className="heading_style">
        🎰 <span>Slot Machine Game</span> 🎰
      </h1>
      <div className="slotMachine">
        <Slotmachine x="😆" y="😆" z="😆" />
        <Slotmachine x="😮" y="👱" z="☠️" />
        <Slotmachine x="😆" y="💃" z="👶" />
        <Slotmachine x="😆" y="😆" z="😆" />
        <Slotmachine x="😆" y="💃" z="👶" />
        <Slotmachine x="😆" y="💃" z="👶" />
        <Slotmachine x="😆" y="💃" z="👶" />
        <Slotmachine x="😆" y="💃" z="👶" />
        <Slotmachine x="😆" y="💃" z="👶" />
        <Slotmachine x="😆" y="💃" z="👶" />
        <Slotmachine x="😆" y="💃" z="👶" />
        <Slotmachine x="😆" y="💃" z="👶" />
        <Slotmachine x="😆" y="💃" z="👶" />
        <Slotmachine x="😆" y="💃" z="👶" />
